function tooltip() {
    $("img.tooltip").mouseover(function (b) {
        var c = this.name;
        $(this).removeAttr("title");
        old_title = c;
        x = b.pageX + 5;
        y = b.pageY + 5;
        $("body").append("<div id='tooltip'>" + c + "</div>");
        $("#tooltip").css("left", x).css("top", y)
    });
    $("span.tooltip").mouseover(function (b) {
        var c = this.id;
        x = b.pageX + 5;
        y = b.pageY + 5;
        $("body").append("<div id='tooltip'>" + c + "</div>");
        $("#tooltip").css("left", x).css("top", y)
    });
    $("input.tooltip").mouseover(function (b) {
        var c = this.title;
        $(this).removeAttr("title");
        old_title = c;
        x = b.pageX + 5;
        y = b.pageY + 5;
        $("body").append("<div id='tooltip'>" + c + "</div>");
        $("#tooltip").css("left", x).css("top", y)
    });
    $("img.tooltip").mouseout(function (b) {
        $("#tooltip").remove()
    });
    $("span.tooltip").mouseout(function (b) {
        $("#tooltip").remove()
    });
    $("input.tooltip").mouseout(function (b) {
        $("#tooltip").remove();
        $(this).attr("title", old_title)
    })
}
$(document).ready(function () {
    $(".defaultText").focus(function (b) {
        if ($(this).val() == $(this)[0].title) {
            $(this).removeClass("defaultTextActive");
            $(this).val("")
        }
    });
    $(".defaultText").blur(function () {
        if ($(this).val() == "") {
            $(this).addClass("defaultTextActive");
            $(this).val($(this)[0].title)
        }
    });
    $(".defaultText").blur();
    $("#search").submit(function () {
        clearInputs()
    });
    $("#qsearch").submit(function () {
        clearInputs()
    });
    $("#browse").submit(function () {
        clearInputs()
    })
});

function clearInputs() {
    var d = $(":input");
    var c = d.length;
    for (var b = 0; b < c; b++) {
        if (d[b].title == d[b].value) {
            d[b].value = ""
        }
    }
}
