function strchlen(d) {
    var b, c;
    b = 0;
    for (c = 0; c < d.length; c++) {
        if (d.charCodeAt(c) > 255) {
            b++
        }
    }
    return b
}
function strenlen(d) {
    var b, c;
    b = 0;
    for (c = 0; c < d.length; c++) {
        while (d.charAt(c) == " " || d.charCodeAt(c) > 255 || d.charAt(c) == "\n") {
            c++
        }
        if (d.charAt(c + 1) == " " || d.charAt(c + 1) == "\n" || d.charCodeAt(c + 1) > 255 || c == d.length - 1) {
            b++
        }
    }
    return b
}
