function roundit(d, b) {
    if (b > 0) {
        if ((d.toString().length - d.toString().lastIndexOf(".")) > (b + 1)) {
            var c = Math.pow(10, b);
            return Math.round(d * c) / c
        } else {
            return d
        }
    } else {
        return Math.round(d)
    }
}
